INSERT INTO `uah_mad_g5`.`tbl_noticia` (`idNoticia`, `permalink`, `titulo`, `imagen`, `idUsuario`, `texto`) VALUES ('1', '0', 'Qu pas con Domenicali que enfad a Red Bull F1?', 'data:image/jpeg;base64,', '1', 'El mismo da que Red Bull presentaba su decoracin para la temporada 2023, revel su asociacin con Ford de cara a 2026. El regreso de una firma histrica (y laureada) a la categora dos dcadas despus mereca un evento por todo lo alto, y por ello estaba invitado el director general de la Frmula 1, Stefano Domenicali.');
INSERT INTO `uah_mad_g5`.`tbl_noticia` (`idNoticia`, `permalink`, `titulo`, `imagen`, `idUsuario`, `texto`) VALUES ('2', '0', 'Verstappen, animado por los nuevos neumticos Pirelli de F1 2023', 'data:image/jpeg;base64,', '1', 'El piloto de Red Bull es conocido por preferir un eje delantero ms efectivo para que los monoplazas sean nerviosos en la parte trasera. Ese rasgo era el contrario con el que el RB18 empez en la temporada 2022 debido a la combinacin de sobrepeso y subviraje de la nueva generacin de neumticos Pirelli.');
INSERT INTO `uah_mad_g5`.`tbl_noticia` (`idNoticia`, `permalink`, `titulo`, `imagen`, `idUsuario`, `texto`) VALUES ('3', '0', 'McLaren cambia el nombre de su F1 y muestra la primera imagen', 'data:image/webp;base64,', '1', 'Como era de esperar, el coche de la escudera de Woking recibira el nombre de MCL37 para continuar con la lnea que sigui a los mticos \'MP4\', pero a pocos das de su presentacin, McLaren decidi sorprender a todos los aficionados con una nueva nomenclatura. A travs de un vdeo publicado en sus redes sociales, los britnicos anunciaron que su criatura se llamara MCL60, en honor a las seis dcadas de historia de la firma.');
INSERT INTO `uah_mad_g5`.`tbl_noticia` (`idNoticia`, `permalink`, `titulo`, `imagen`, `idUsuario`, `texto`) VALUES ('4', '0', 'Russell: \"He asumido que todo lo que diga va a ser analizado con lupa\"', 'data:image/webp;base64,', '1', 'El joven britnico sorprendi a propios y extraos en el Gran Premio de Singapur de 2022, cuando cuestion la agresividad de Mick Schumacher en su batalla por la posicin.');
INSERT INTO `uah_mad_g5`.`tbl_noticia` (`idNoticia`, `permalink`, `titulo`, `imagen`, `idUsuario`, `texto`) VALUES ('5', '0', 'Bottas reconoce que sufri un trastorno alimentario en F1', 'data:image/webp;base64,', '1', 'El piloto de Alfa Romeo estuvo en la presentacin de su equipo para la temporada 2023 de Frmula 1, donde revelaron el aspecto del C43. Ser la undcima campaa del finlands en el Gran Circo, una categora que le ha visto crecer desde que se estren con Williams hace una dcada y en la que ha conseguido diez victorias hasta la fecha, todas con Mercedes.');
